INSERT INTO `zgrada` (`zgrada_id`, `naziv`, `opstina`, `ulica`, `broj`, `opis`, `fakultet_id`, `restoran_id`, `dom_id`) VALUES
(58, '4.april', 'Voždovac', 'Vojvode Stepe', '320', 'Sa?injavaju ga A blok sa zasebnim kupatilima i B blok sa spratnim kupatilima.\n		Studenti su smešteni u ukupno 290 soba.\n		Nalazi se u blizini FON-a, FPN-a, Visoke elektrotehni?ke škole, Saobra?ajnog\n		i Farmaceutskog fakulteta.\n		Specifi?nosti doma su moderno opremljena teretana, otvoreni tereni za fudbal, \n		rukomet, košarku i odbojku, sportska sala sa stolovima za stoni tenis, ambulanta \n		Studentske poliklinike, blizina sportskog centra \"Banjica\".', NULL, NULL, 101),
(59, 'Karaburma', 'Palilula', 'Mije Kova?evi?a', '7b', 'Obe kule broje 690 studentskih soba. Zajedni?ka ( spratna) kupatila zadovoljavaju visoke standarde.\n		U ?itaonicu studentskog doma \"KARABURMA\" može se u?i isklju?ivo uz pomo? studentske kartice.\n		Studentima su na raspolaganju sala za tribine i predstave, teretana, klub, pošta,\n		ambulanta Studentske poliklinike, nekoliko komercijalnih objekata, igralište i studentski restoran.\n		Svake godine, po?etkom septembra, brucoši iz zemlje i okruženja predaju dokumenta  po konkursu za \n		prijem u dom u Maloj sali studentskog doma', NULL, NULL, 102),
(60, 'Kralj Aleksandar I', 'Zvezdara', 'Bulevar Kralja Aleksandra I', '75', 'Svojom spoljašnjom autenti?noš?u i luksuzno ure?enim enterijerom, jedan je od najlepših i najsavremenijih studentskih domova.\n		Moderno je opremljen i broji 195 studentskih soba. Dom ima video nadzor i internet u svim sobama.\n		Impresivan hol i hodnici svedo?e o otmenosti gra?anske Srbije izme?u dva rata, a sobe pružaju studentima-stanarima ose?aj sigurnosti i udobnosti.\n		Lociran u samom centru Beograda, omogu?ava svojim stanarima da brzo stignu do svojih fakulteta, ali i do svih gradskih sadržaja, zanimljivih za studente.\n		U okviru doma nalazi se i studentski restoran.', NULL, NULL, 103),
(61, 'Košutnjak', '?ukarica', 'Blagoja Parovi?a', '156', 'Studentske sobe kojih ima 123, raspore?ene su u A i B bloku.\n		U blizini doma nalaze se Fakultet za sport i fizi?ko vaspitanje, Šumarski fakulteti i Visoka hotelijerska škola.\n		Specifi?nost doma ?ini atraktivno okruženje, blizina park šume Košutnjak, otvorenih bazena i vešta?ke ski staze.\n		Dom raspolaže elektronskim bravama, a studenti su u mogu?nosti da pale ili gase svetlo u sobama pomo?u studentske kartice.', NULL, NULL, 104),
(62, 'Mika Mitrovi?', 'Voždovac', 'Kralja Vladimira', '33', 'Potpuno je renoviran u skladu sa potrebama studenata-stanara i zahtevima studentskog standarda.\n		Apartmani u prizemlju kojih ima 12,u potpunosti su prilago?eni studentima sa invaliditetom. Smeštaj je obezbe?en i njihovim personalnim asistentima.\n		Renoviran je i studentski restoran u okviru doma. Ostatak kapaciteta koji podrazumeva 67 soba na spratu, rezervisan je za sve ostale studente koji su \n		kunkurisali za smeštaj u ovom domu.\n		U svim sobama postoji priklju?ak za internet i kablovski TV sistem. Smešten u mirnom delu Voždovca, ovaj dom nudi izvanredne uslove za u?enje i odmor \n		od gradske vreve.', NULL, NULL, 105),
(63, 'Patris Lumumba', 'Zvezdara', 'Ljubice Lukovi?a', '1', 'U okviru ovog doma nalaze se studentski restoran, terena za sportske aktivnosti i ostale prostorijame neophodne za u?enje i društveni život studenata.\n		Sa renoviranjem II bloka, broj studentskih soba popeo se na 443.\n		Devojke su useljene u IV, V i VI blok, a mladi?i u I i III, dok je II blok mešovit.\n		Specifi?nost doma ?ini to što svake godine primi najviše brucoša, kao i položaj koji omogu?ava studentima da lako stignu do svojih fakulteta.', NULL, NULL, 106),
(64, 'Rifat Burdževi?', 'Zvezdara', 'Milana Raki?a', '77', 'U sobama, pored uobi?ajenog nameštaja , postoji priklju?ak za internet.\n		Studentima su na raspolaganju ?itaonica, klub i prodavnica komercijalnog tipa. Specifi?nost doma ?ini prijatna atmosfera, blizina Zvezdarske šume, SC \"Olimp\".\n		Deo kapaciteta rezervisan je za strane studente.\n		Video nadzor, kao u svim ostalim domovima, na zavidnom je nivou.\n		Prema anketama koje se vrše me?u studentima, studentski restoran \"Rifat\" ocenjen je kao najbolji me?u studentskim restoranima u Beogradu.', NULL, NULL, 107),
(65, 'Studentski grad', 'Novi Beograd', 'Tošin Bunar', '143-151', 'U okviru svakog doma nalaze se portirnica i video nadzor. Svaka soba ima priklju?ak za internet.\n		- Dom I sadrži 440 studentskih soba, hol sa recepcijom, ambulantu Studentske poliklinike, hostelski deo.\n		- U Domu II studenti se mogu smestiti u 521 sobu.\n		Osim soba i ?itaonica, u ovom domu nalazi se kancelarije Službe za informacione tehnologije, fotokopirnica, \n			frizerski salon, prostorije RTV STUDENTSKI GRAD, Foto klub, književni klub \"Branko Miljkovi?\", \n			guslarsko društvo, sportsko društvo \"Studentski grad\". U oba doma, od 2011. godine, smešteni su strani studenti, \n			stipendisti Vlade Republike Srbije koji studiraju na fakultetima Univerziteta u Beogradu.\n		- Dom III broji 512 studentskih soba a u njemu su smeštene prostorije AKUD-a \"Španac\" i pošta.\n		- Dom IV raspolaže sa 504 studentske sobe. U njemu se nalazi i Paraklis sv. Jovana Zlatoustog.\n \n		Kroz ovaj kompleks prošlo je na hiljade studenta, ispri?ano nebrojeno pri?a, sa?uvano mnogo dragih uspomena.\n		O Studenjaku su bivši stanari govrili, pisali, snimali filmove, u njemu odre?ivali svoje živote, sticali ljubavi i prijateljstva. Se?aju ga se sa osmehom.\n		Autenti?an i još uvek najve?i na Balkanu, Studentski grad je do danas zadržao tradiciju omiljene studentske ku?e.', NULL, NULL, 108),
(66, 'Slobodan Penezi?', 'Zvezdara', 'Bana Ivaniša', 'bb', 'Dom broji 378 studentskih soba. Idealan je za u?enje i odmor jer je zašti?en od gradske buke.\n		U svakoj sobi postoji priklju?ak za internet .\n		U prvom paviljonu smeštene su studentkinje, dok preostala dva paviljona pripadaju muškim stanarima.\n		Dom nema svoj restoran, pa se njegovi stanari naj?eš?e hrane u restoranu susednog doma „Rifat Burdževi?” koji je udaljen oko 200 metara.\n		Zbog blizine Zvezdarske šume i Olimpa, stanari imaju zavidne uslove za sport i rekreaciju.', NULL, NULL, 109),
(67, 'Vera Blagojevi? 1', 'Palilula', '27.marta', '48', 'Studentski dom Vera Blagojevi? I ili popularno Vera I, bio je prvi ženski studentski dom. Izgra?en 1936. godine, \n		prvobitno je nosio ime Kraljica Marija. Dom je smešten u dve zgrade u centru grada i namenjen je isklju?ivo za smeštaj studentkinja. \n		Dom Vera I spada u najsre?enije domove Studentskog centra Beograd. Posebnu pogodnost ovog doma predstavlja domski vrt, koji doprinosi\n		njegovoj atraktivnosti.\n		Sobe u studentskom domu Vera Blagojevi? I su dvokrevetne, trokrevetne i apartmani. Sadrže osnovnu opremu kao što su kreveti, \n		radni stolovi sa stolicama i lampama, plakari i police, ali i direktnu telefonsku liniju i priklju?ak za satelitsku i internu kablovsku televiziju. \n		Sobe koje su u dva nivoa imaju i ?ajnu kuhinju sa frižiderom i kupatilom.', NULL, NULL, 110),
(68, 'Vera Blagojevi? 2', 'Palilula', 'Dalmatinska', '37', 'Studentski dom Vera Blagojevi? II ili popularno Vera II, bio je prvi ženski studentski dom. Izgra?en 1936. godine, \n		prvobitno je nosio ime Kraljica Marija. Dom je smešten u dve zgrade u centru grada i namenjen je isklju?ivo za smeštaj studentkinja.\n		Smeštaj u domu Vera II dosta se razlikuje od smeštaja u domu Vera I.\n		Sobe u studentskom domu Vera Blagojevi? II su dvokrevetne, trokrevetne i apartmani. Sadrže osnovnu opremu kao što su kreveti, \n		radni stolovi sa stolicama i lampama, plakari i police, ali i direktnu telefonsku liniju.', NULL, NULL, 111),
(69, 'Žarko Marinovi?', 'Zemun', 'Cara Dušana', '254', 'Studentski dom \"Žarko Marinovi?\" predstavlja najmanji objekat Ustanove studentski centar \"Beograd\".\n		Broji 46 studentskih soba. Kupatila su zajedni?ka (spratna).\n		Deo zgrade dom deli sa Višom medicinskom školom, a u blizini su Poljoprivredni fakultet i Policijska akademija.\n		Lako je do?i i do svih visokoškolskih ustanova smeštenih na Novom Beogradu.\n		Specifi?nost doma ogleda se u tome što najve?i broj stanara ?ine brucoši.\n		Studenti smatraju da je studentski restoran u okviru ovog doma jedan od najboljih studentskih restorana u Beogradu.', NULL, NULL, 112),
