(84, 'Ekonomski fakultet', 'Savski venac', 'Kameni?ka', '6', 'Ekonomski fakultet Univerziteta u Beogradu je obrazovna i nau?na ustanova sa tradicijom dugom skoro 80 godina. \n			Osnovan je kao Visoka škola za ekonomiju i trgovinu još daleke 1937. godine, kao vode?i visokoškolski obrazovni \n			centar u oblasti ekonomije u tadašnjoj Kraljevini Jugoslaviji.\n			Danas je Ekonomski fakultet najve?a i najeminentnija nau?no-obrazovna ustanova u regionu u polju ekonomskih nauka, \n			poslovnog upravljanja i statistike. Fakultet zapošljava oko 130 nastavnika i saradnika od ?ega 55 redovnih Profesora. \n			Na Fakultetu je do sada diplomiralo preko 46000 studenata, preko 3500 je nastavilo poslediplomske studije i steklo\n			naziv magistra nauka ili mastera dok je oko 760 steklo titulu doktora nauka.', 301, NULL, NULL),
(85, 'Pravni fakultet', 'Palilula', 'Bulevar kralja Aleksandra', '67', 'Pravni fakultet Univerziteta u Beogradu, kao deo jednog od najstarijih univerziteta na Balkanu, sa temeljima u prvoj\n			polovini 19. veka, bio je uvek vode?a srpska i jugoslovenska obrazovna i nau?na institucija u oblasti prava. Okupljao je \n			vrhunske nau?nike i vrsne predava?e koji su obrazovali oko 50.000 diplomiranih pravnika i preko 2.000 magistara i doktora\n			nauka. Studije ovog Fakulteta predstavljale su rasadnik najprestižnijih stru?njaka, nau?nika i nastavnika za celu bivšu \n			Jugoslaviju.', 302, NULL, NULL),
(86, 'Pravoslavni bogoslovski fakultet', 'Palilula', 'Mije Kova?evi?a', '11b', 'Danas na Pravoslavnom bogoslovskom fakultetu studira više od 1.800 mladi?a i devojaka koji se osposobljavaju za svešteni?ki,\n			verou?iteljski poziv i nau?ni rad u oblasti teologije. Na Fakultetu predaje 42 nastavnika i saradnika. U predava?kom sastavu\n			zastupljeni su i ugledni arhijereji naše Crkve, sveštenici, monasi.', 303, NULL, NULL),
(87, 'U?iteljski fakultet', 'Stari grad', 'Kraljice Natalije', '43', 'Obrazovanje u?itelja u Srbiji ima dugu tradiciju i ono traje punih 180 godina. Pamte se tri datuma u razvoju obrazovanja \n			u?itelja: januara 1871. godine po?inje sa radom U?iteljska škola u Srbiji, sa sedištem u Kragujevcu. 1878. godine ona je preseljena \n			u Beograd. 1812. godine osnovana je Prva srpska U?iteljska škola u Sent Andreji, koja je 1816. godine preseljena u Sombor. U?iteljska \n			škola u Beogradu deluje od 1878. godine, sa prekidima u ratnim godinama, sve do septembra 1972. godine. Septembra meseca 1972. godine \n			zapo?ela je sa radom Pedagoška akademija u Beogradu, a za proteklih dvadeset godina u njoj je diplomiralo hiljadu nastavnika razredne \n			nastave.', 304, NULL, NULL),
(88, 'Fakultet bezbednosti', 'Voždovac', 'Gospodara Vu?i?a', '50', 'Fakultet bezbednosti je visokoškolska obrazovno-nau?na institucija u sastavu Univerziteta u Beogradu i pripada grupi fakulteta \n		društveno-humanisti?kih nauka. Svojim planom i programom Fakultet pokriva me?usobno povezane sociološke, politi?ke, pravne, ekonomske, \n		eti?ke, psihološke, humanitarne, civilno-vojne i druge aspekte bezbednosti, ljudskih i socijalnih resursa, odbrane, civilne zaštite i \n		zaštite životne sredine.', 305, NULL, NULL),
(89, 'Fakultet za specijalnu edukaciju i rehabilitaciju', 'Stari grad', 'Visokog Stevana', '2', 'Defektološki fakultet je po?eo sa radom 10. novembra 1975. godine. To je bio po?etak uspona jedne Profesije koja je u proteklih\n		trideset godina tražila i pronalazila svoje puteve, poštovala svoju tradiciju, razvijala nau?nu misao i primenjivala savremene tendencije\n		u obrazovanju mladih stru?njaka. Istorijski posmatrano, defektologija je napravila nekoliko teških i džinovskih koraka u svom \n		razvoju, od srednjovekovne Srbije i brige o hendikepiranima na njenom tlu, do prolaska kroz svetske ratove i le?enje zaostalih rana, \n		koje su ?esto ostavljale neizbrisivi hendikep kojem je trebalo znala?ki pri?i, do današnjih najsavremenijih pristupa u edukaciji \n		i rehabilitaciji.', 306, NULL, NULL),
(90, 'Fakultet politi?kih nauka', 'Voždovac', 'Jove Ili?a', '165', 'Univerzitet u Beogradu – Fakultet politi?kih nauka (FPN) ve? 40 godina predstavlja vode?u instituciju u oblasti visokog obrazovanja\n			koja je danas moderna i otvorena škola demokratije i demokratske politi?ke kulture, sposobna da aktivno u?estvuje i unapre?uje \n			politi?ki diskurs i odgovori na osnovne imperative politi?ke egzistencije našeg društva i njegovog me?unarodnog okruženja. Osnovan \n			je 1968. godine kao prva nastavno-nau?na ustanova te vrste u tadašnjoj Jugoslaviji.', 307, NULL, NULL),
(91, 'Fakultet sporta i fizi?kog vaspitanja', '?ukarica', 'Blagoja Parovi?a', '156', 'Fakultet sporta i fizi?kog vaspitanja Univerziteta u Beogradu je nau?no-obrazovna institucija, koja u kontinuitetu, od 1946. godine, \n			obrazuje visokoškolske kadrove za fizi?ko vaspitanje u školama, sport i rekreaciju. Koreni Fakulteta sežu od 1938. godine kada je \n			formirana prva jednogodišnja škola za obrazovanje kadrova iz naše struke, odnosno do 1939. godine kada je po?ela sa radom Škola za \n			telesno vaspitanje u rangu više škole.', 308, NULL, NULL),
(92, 'Filozofski fakultet', 'Stari grad', '?ika Ljubina', '18-20', 'Filozofski fakultet je najstariji fakultet Univerziteta u Beogradu, ?iji po?eci sežu u 1838. godinu kada je aktom kneza Miloša u \n			Kragujevcu osnovan Licej. Danas je Filozofski fakultet moderna škola koja prati sve savremene tokove evropskog akademskog prostora.', 309, NULL, NULL),
(93, 'Filološki fakultet', 'Stari grad', 'Studentski trg', '3', 'Filološke discipline imaju dugu tradiciju u srpskom školstvu, pa i u onom univerzitetskog tipa. Otuda se Filološki fakultet može \n			smatrati jednim od najstarijih na srpskim univerzitetima, mada je kao samostalan fakultet po?eo da dela tek od 1960. godine, \n			kada se izdvojio iz Filozofskog fakulteta i formirao kao posebna nau?na i nastavna visokoškolska ustanova.', 310, NULL, NULL),
(94, 'Biološki fakultet', 'Stari grad', 'Studentski trg', '16', 'Dvadeseti vek je svedok prevazilaženja u biologiji ranijeg okvira iste kao deskriptivne i kvantitativne nauke. Otkri?a molekularnih\n			mehanizama ujedinila su u savremenim istraživa?kim naporima biohemiju, citologiju, genetiku, fiziologiju i ostale biološke \n			discipline, te se dvadesetprvi vek ozna?va kao vek biologije.\n			Dostignu?a ?itavog niza razli?itih nau?nih disciplina u okvirima biologije kao jedne kompleksne nauke, daju nov podsticaj u \n			prou?avanju funkcionalne raznolikosti izme?u pojedinih vrsta mikroorganizama, gljiva, biljaka i životina, a posebno ?oveka.', 311, NULL, NULL),
(95, 'Geografski fakultet', 'Stari grad', 'Studentski trg', '3/III', 'Geografski fakultet je državna visokoškolska ustanova ?ije su osnovne delatnosti visoko obrazovanje i nau?ni rad. Fakultet \n			izvodi studije na 3 stepena; osnovne, master i doktorske studije. Studije se odvijaju na srpskom jeziku, ali pruža se mogu?nost \n			da se pojedini delovi studija kao i doktorske disertacije rade na bilo kom željenom jeziku.', 312, NULL, NULL),
(96, 'Matemati?ki fakultet', 'Stari grad', 'Studentski trg', '16', 'Geografski fakultet je državna visokoškolska ustanova ?ije su osnovne delatnosti visoko obrazovanje i nau?ni rad. Fakultet \n			izvodi studije na 3 stepena; osnovne, master i doktorske studije. Studije se odvijaju na srpskom jeziku, ali pruža se mogu?nost \n			da se pojedini delovi studija kao i doktorske disertacije rade na bilo kom željenom jeziku.', 313, NULL, NULL),
(97, 'Fakultet za fizi?ku hemiju', 'Stari grad', 'Studentski trg', '12-16', 'Fizi?ka hemija na Univerzitetu u Beogradu se predaje od 1903. godine. Delatnosti Fakulteta za fizi?ku hemiju danas su visoko obrazovanje \n			i nau?noistraživa?ki rad od posebnog zna?aja za Republiku Srbiju, a koji su uskla?eni sa me?unarodnim, posebno evropskim obrazovnim i\n			nau?nim prostorom. Osnovna delatnost Fakulteta se obavlja u skladu sa zakonima o visokom obrazovanju i o nau?noistraživa?kom radu,\n			kao i sa statutima Univerziteta u Beogradu i Fakulteta.', 314, NULL, NULL),
(98, 'Fizi?ki fakultet', 'Stari grad', 'Studentski trg', '12', 'Fizi?ka hemija na Univerzitetu u Beogradu se predaje od 1903. godine. Delatnosti Fakulteta za fizi?ku hemiju danas su visoko obrazovanje \n			i nau?noistraživa?ki rad od posebnog zna?aja za Republiku Srbiju, a koji su uskla?eni sa me?unarodnim, posebno evropskim obrazovnim i\n			nau?nim prostorom. Osnovna delatnost Fakulteta se obavlja u skladu sa zakonima o visokom obrazovanju i o nau?noistraživa?kom radu,\n			kao i sa statutima Univerziteta u Beogradu i Fakulteta.', 315, NULL, NULL),
(99, 'Hemijski fakultet', 'Stari grad', 'Studentski trg', '12-16', 'Današnji Hemijski fakultet, kao institucija Beogradskog Univerziteta, vodi poreklo iz Liceja (1838-1863) i Velike škole (1863-1905). Licej je \n			u po?etku imao dva odeljenja: Filozofsko i Pravno. Godine 1853. na Liceju je formirano novo Prirodno-tehni?ko odeljenje na kojem se, \n			pored ostalih nauka, po?ela izu?avati i hemija. Od osnivanja do danas na ovom fakultetu diplomiralo je 2898 studenata. Fakultet je \n			dao 97 specijalista i 345 magistara, kao i 204 doktora hemijskih nauka. ?etiri Profesora Hemijskog fakulteta su ?lanovi Srpske 4\n			akademije nauka i umetnosti.', 316, NULL, NULL),
(100, 'Medicinski fakultet', 'Savski venac', 'dr Suboti?a', '8', 'Studije medicine, koje se obavljaju na Medicinskom fakultetu Univerziteta u Beogradu, ?ine obuka lekara – obuka srednjoškolaca da postanu lekari,\n			obuka lekara da postanu lekari specijalisti, obuka specijalista da postanu supspecijalisti, kontinuirana obuka svih profila \n			lekara radi upoznavanja sa poslednjim dostignu?ima medicinske nauke i struke, obuka istraživa?a u medicinskim naukama. Pomenuti\n			posao se obavlja u skladu sa misijom Medicinskog fakulteta.', 317, NULL, NULL),
(101, 'Stomatološki fakultet', 'Savski venac', 'dr Suboti?a', '8', 'Stomatološki fakultet Univerziteta u Beogradu vode?a je nastavna, nau?na i stru?na ustanova u oblasti stomatologije u zemlji. Zadatak Fakulteta je \n			da osposobi studente, budu?e doktore stomatologije, da pacijentima pružaju usluge najvišeg kvaliteta i da kod njih razvije želju za\n			neprekidnim usavršavanjem. Tako?e zadatak je i da najtalentovanijim doktorima stomatologije omogu?i dalje usavršavanje i uputi ih u \n			tajne nau?noistraživa?kog rada.', 318, NULL, NULL),
(102, 'Fakultet veterinarske medicine', 'Savski venac', 'Bulevar oslobo?enja', '18', 'Fakultet veterinarske medicine Univerziteta u Beogradu smešten je u blizini centra grada u Bulevaru oslobo?enja 18, nekoliko stotina metara od centralnog\n			gradskog trga Slavije u smeru prema Autokomandi. U neposrednoj blizini fakulteta nalaze se Medicinski i Stomatološki fakultet. U \n			vreme kada je fakultet osnovan, dakle pre više od sedamdeset godina, nalazio se na rubu Beograda koji se po?eo naglo razvijati.\n			U poslednje vreme razmišlja se o dislokaciji fakulteta iz centra grada.', 319, NULL, NULL),
(103, 'Farmaceutski fakultet', 'Voždovac', 'Vojvode Stepe', '450', 'Farmaceutski odsek pri Medicinskom fakultetu Beogradskog univerziteta osnovan je 24. oktobra 1939. U samostalnu visokoškolsku ustanovu Farmaceutski fakultet \n			prerasta 19. oktobra 1945. godine. Dugi niz godina nastava na fakultetu se odvijala u objektima Medicinskog fakulteta, a od septembra 1991. godine \n			Farmaceutski fakultet dobija svoju zgradu u ulici Vojvode Stepe 450. Od osnivanja pa do kraja 2007. godine na Farmaceutskom fakultetu \n			diplomiralo je 9.284 studenata, završilo specijalizaciju 1.788 kandidata (1.176 specijalizacija za potrebe zdravstva), odbranjeno je \n			286 magistarskih teza i 239 doktorskih disertacija.', 320, NULL, NULL),
(104, 'Arhitektonski fakultet', 'Palilula', 'Bulevar kralja Aleksandra', '73/II', 'Farmaceutski odsek pri Medicinskom fakultetu Beogradskog univerziteta osnovan je 24. oktobra 1939. U samostalnu visokoškolsku ustanovu Farmaceutski fakultet \n			prerasta 19. oktobra 1945. godine. Dugi niz godina nastava na fakultetu se odvijala u objektima Medicinskog fakulteta, a od septembra 1991. godine \n			Farmaceutski fakultet dobija svoju zgradu u ulici Vojvode Stepe 450. Od osnivanja pa do kraja 2007. godine na Farmaceutskom fakultetu \n			diplomiralo je 9.284 studenata, završilo specijalizaciju 1.788 kandidata (1.176 specijalizacija za potrebe zdravstva), odbranjeno je \n			286 magistarskih teza i 239 doktorskih disertacija.', 321, NULL, NULL),
(105, 'Gra?evinski fakultet', 'Palilula', 'Bulevar kralja Aleksandra', '73/I', 'Gra?evinski fakultet Univerziteta u Beogradu je najstarija i najviša obrazovna i nau?na institucija u oblasti gra?evinarstva i geodezije u našoj zemlji.\n			Fakultet ima dugu i bogatu tradiciju, po?eci nastave iz oblasti gra?evinarstva na ovim prostorima vezuju se za 1846. godinu kad \n			je Knjaz Srpski Aleksandar Kara?or?evi? svojim ukazom osnovao Indžinirsku školu u Beogradu. Stoga se ova godina nalazi i na grbu\n			našeg fakulteta uz latinske re?i studere, docere, aedificare koje simbolizuju delatnost fakulteta u oblasti nastave, nauke i \n			struke. Inženjeri potekli sa gra?evinskog fakulteta su ostvarili mnoge zna?ajne uspehe u projektovanju i gra?enju svih vrsta \n			objekata u zemlji i inostranstvu, od kojih veliki broj spada u vrhunska graditeljska ostvarenja. Veliki broj bivših studenata \n			fakulteta radi u najprestižnijim svetskim gra?evinskim firmama odnosno na najpoznatijim univerzitetima u svetu.', 322, NULL, NULL),
(106, 'Elektrotehni?ki fakultet', 'Palilula', 'Bulevar kralja Aleksandra', '73', 'Razvoj Elektrotehni?kog fakulteta u bliskoj je vezi sa istorijom univerzitetskog obrazovanja u Srbiji. Prvo visokoškolsko predavanje iz oblasti \n			elektrotehnike održano je davne 1894. Profesor Stevan Markovi? bio je prvi predava? i osniva? Elektrotehni?ke katedre Inženjerskog \n			odeljenja Velike škole u Beogradu. Samo ?etiri godine kasnije, profesor Markovi? je osnovao i elektroinženjersku laboratoriju. Od \n			tada, elektrotehni?ke teme su se izu?avale na Velikoj školi, a zatim i na beogradskom Univerzitetu koji je iz nje nastao 1905. Prve \n			diplome dodeljene su 1922 godine.', 323, NULL, NULL),
(107, 'Mašinski fakultet', 'Palilula', 'Kraljice Marij', '16', 'Mašinski fakultet Univerziteta u Beogradu je najstarija i najve?a visokoškolska i nau?na ustanova u Srbiji i Jugoslaviji u oblasti mašinstva.', 324, NULL, NULL),
(108, 'Poljoprivredni fakultet', 'Zemun', 'Nemanjina', '6', '\"Od skromnog po?etka sa nekoliko nastavnika, tri redovna, jednim vanrednim i tri honorarna, Poljoprivredni fakultet je danas jedna od vode?ih \n			visokoškolskih ustanova u ovom delu Evrope, sa preko 500 zaposlenih i permanentim brojem od oko 4.500 studenata.', 325, NULL, NULL),
(109, 'Rudarsko-geološki fakultet', 'Palilula', '?ušina', '7', 'Rudarsko-geološki fakultet je obrazovno-nau?na ustanova u sastavu Univerziteta u Beogradu. Obrazuje stru?njake na osnovnim, specijalisti?kim, \n			magistarskim i doktorskim studijama. Uz to obavlja inovacije znanja, stru?nog obrazovanja i usavršavanja iz mati?nih oblasti, \n			kao i nau?noistraživa?ki rad. Do sada je na fakultetu diplomiralo 6437 studenata, magistriralo 590, specijaliziralo 17, a odbranilo \n			doktorsku disertaciju 448 kandidata.', 326, NULL, NULL),
(110, 'Saobra?ajni fakultet', 'Voždovac', 'Vojvode Stepe', '305', 'Prate?i razvoj saobra?ajne struke i nauke kao i potrebe privrede za diplomiranim saobra?ajnim inženjerima, Saobra?ajni fakultet je u proteklih \n			pedeset pet godina jedanaest puta vršio inovaciju nastavnih planova i programa. Svaki od njih odražavao je sve bogatije iskustvo \n			nastavnika i saradnika u nauci i obrazovanju, i koristio povratne informacije od saobra?ajnih inženjera iz prakse kao i velikog\n			broja korisnika usluga iz privrede, raznih državnih i društvenih organizacija i ustanova. Tako?e, u ove planove i programe \n			ugra?ivana su i iskustva sli?nih škola u inostranstvu. Na osnovu ovog rada, Saobra?ajni fakultet je mati?an za slede?e nau?ne \n			oblasti u saobra?aju i transportu: planiranje, tehnologija, upravljanje-menadžment, organizacija, projektovanje, eksploatacija, \n			bezbednost, održavanje, ekonomija i logistika.', 327, NULL, NULL),
(111, 'Saobra?ajni fakultet', 'Bor', 'Vojske Jugoslavije', '12', 'Tehni?ki fakultet u Boru, jedini fakultet Univerziteta u Beogradu lociran van sedišta univerziteta, osnovan je 1961. godine kao odgovor na izražene \n			potrebe za visokoobrazovanim kadrom iz oblasti rudarstva i metalurgije u vreme dinami?nog razvoja Rudarsko-topioni?arskog basena Bor.', 328, NULL, NULL),
(112, 'Tehnološko-metalurški fakultet', 'Palilula', 'Kernegijeva', '4', 'Tehnološko-metalurški fakultet u Beogradu je najstarija visoko obrazovna i nau?na institucija iz oblasti hemijskih tehnologija u našoj zemlji, \n			sa bogatom tradicijom, svetskim priznatim rezultatima i visokim ugledom. Fakultet obezbe?uje stru?njake za širok spektar kreativnih poslova iz razli?itih oblasti.', 329, NULL, NULL),
(113, 'Fakultet organizacionih nauka', 'Voždovac', 'Jove Ili?a', '154', 'Organizacione nauke, koje doživljavaju puni razvoj u drugoj polovini 20. veka, dale su zna?ajan doprinos razvoju privrede i društva u celini. Intenzivni razvoj \n			organizacionih nauka definisanih u oblastima menadžmenta i informacionih sistema i tehnologija uslovio je rast efikasnosti i \n			napredovanje poslovnih sistema. To je podstaklo nastanak velikog broja institucija visokog obrazovanja u ovoj oblasti. U bivšoj \n			Jugoslaviji, prve ideje za formalnim obrazovanjem u oblasti organizaconih nauka pojavile su se pre više od pedeset godina. Kao plod \n			takvih inicijativa i evidentne potrebe za obrazovanjem stru?njaka koji ?e voditi preduze?a i biti nosioci razvoja i promena, \n			1969. godine je doneta odluka o osnivanju Fakulteta organizacionih nauka u Beogradu. U januaru 1971. godine odlukom Saveta \n			Univerziteta u Beogradu, Fakultet organizacionih nauka je postao ?lanica Univerziteta.', 330, NULL, NULL),
(114, 'Šumarski fakultet', '?ukarica', 'Kneza Višeslava', '1', 'Šumarski fakultet Univerziteta u Beogradu je najstarija i najviša visokoškolska i nau?na institucija u oblasti šumarstva, prerade drveta, pejzažne arhitekture i \n			hortikulture i ekološkog inženjeringa u zaštiti zemljišnih i vodnih resursa u Srbiji.', 331, NULL, NULL);

